// mockData.js
const mockData = [
    { id: 1, label: 'Item 1', desc: 'Description 1', price: 100, category: 'Category A' },
    { id: 2, label: 'Item 2', desc: 'Description 2', price: 150, category: 'Category A' },
    { id: 3, label: 'Item 3', desc: 'Description 3', price: 200, category: 'Category B' },
    { id: 4, label: 'Item 4', desc: 'Description 4', price: 120, category: 'Category B' },
    // Add more rows as needed
  ];

  export default mockData;
